import './Book.css'

function Book(props){
    return(
        <div className="book-container">
            <div id='container-data1' className="book-data">{props.id}</div>
            <div id='container-data2' className="book-data">{props.title}</div>
            <div id='container-data3' className="book-data">{props.author}</div>
            <div id='container-data4' className="book-data">{props.price}</div>
            
        </div>

    )
}

export default Book;
